  (top_instance->INST_s_shim_shim_arff_rv.set_clk_0)("CLK");
  (top_instance->INST_s_shim_shim_rff_rv.set_clk_0)("CLK");
  (top_instance->INST_ug_src_canPeekWire.set_clk_0)("CLK");
  (top_instance->INST_ug_src_peekWire.set_clk_0)("CLK");
  (top_instance->INST_ug_src_dropWire.set_clk_0)("CLK");
  (top_instance->INST_ug_snk_canPutWire.set_clk_0)("CLK");
  (top_instance->INST_ug_snk_putWire.set_clk_0)("CLK");
  (top_instance->INST_ug_src_1_canPeekWire.set_clk_0)("CLK");
  (top_instance->INST_ug_src_1_peekWire.set_clk_0)("CLK");
